          );
        },
      ),
      floatingActionButton: FloatingActionButton(
        backgroundColor: Colors.green,
        foregroundColor: Colors.white,
        child: Icon(Icons.add),
        onPressed: () {
          showModalBottomSheet(
            isScrollControlled: true,
            context: context,
            builder: (context) {
              return Scaffold(
                appBar: AppBar(
                  backgroundColor: Colors.green,
                  foregroundColor: Colors.white,
                  title: Text("Nuevo Sitio Turístico"),
                ),
                body: Padding(
                  padding: const EdgeInsets.all(20.0),
                  child: Column(
                    children: [
                      TextFormField(
                        controller: txtNombre,
                        decoration: InputDecoration(
                          labelText: "Nombre",
                          hintText: "Nombre del sitio Turístico",
                          icon: Icon(Icons.place),
                        ),
                      ),
                      TextFormField(
                        controller: txtDescripcion,
                        decoration: InputDecoration(
                          labelText: "Descripción",
                          hintText: "Descripción del sitio Turístico",
                          icon: Icon(Icons.description),
                        ),
                      ),
                      TextFormField(
                        controller: txtFechaLanz,
                        decoration: InputDecoration(
                          labelText: "Fecha Lanzamiento",
                          hintText: "Fecha Lanzamiento del sitio Turístico",
                          icon: Icon(Icons.date_range),
                        ),
                      ),
                      TextFormField(
                        controller: txtUbicacion,
                        decoration: InputDecoration(
                          labelText: "Ubicación",
                          hintText: "Ubicación del sitio Turístico",
                          icon: Icon(Icons.location_on),
                        ),
                      ),
                      TextFormField(
                        controller: txtFotografia,
                        decoration: InputDecoration(
                          labelText: "Fotografía",
                          hintText: "Fotografía del sitio Turístico",
                          icon: Icon(Icons.photo),
                        ),
                      ),
                      TextFormField(
                        controller: txtColor,
                        decoration: InputDecoration(
                          labelText: "Color",
                          hintText: "Color del sitio Turístico",
                          icon: Icon(Icons.color_lens),
                        ),
                      ),
                    ],
                  ),
                ),
                floatingActionButton: FloatingActionButton(
                  backgroundColor: Colors.green,
                  foregroundColor: Colors.white,
                  child: Icon(Icons.save),
                  onPressed: () {
                    // Aquí puedes agregar la lógica para guardar el nuevo sitio turístico
                    Navigator.pop(
                        context); // Cierra el modal después de guardar
                  },
                ),
              );
            },
          );
        },
      ),
    );
  }
}

